import React from 'react'
import { useNavigate } from 'react-router-dom'


const HandleClick = () => {
    const navigate = useNavigate();
    const handleClick = () => {
        navigate('../pages/Sign_in.js');
    };

    return <button onClick={handleClick}>Click me</button>;
};

export default HandleClick;
